import { useState, useEffect } from "react";
import { NavLink, useLocation } from "react-router-dom";
import Logo from "../assets/NavLogo.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars, faTimes } from "@fortawesome/free-solid-svg-icons";

const Nav = () => {
  const [hover, setHover] = useState(false);
  let Links = [
    { name: "About Us", link: "/about" },
    { name: "Our Services", link: "/services" },
    { name: "Get Involved", link: "/support" },
    { name: "Contact Us", link: "/contact" },
  ];

  const location = useLocation();

  let [open, setOpen] = useState(false);

  useEffect(() => {
    if (location.pathname) {
      setOpen(false);
    }
  }, [location.pathname]);

  const handleMouseEnter = () => {
    setHover(true);
  };
  const handleMouseLeave = () => {
    setHover(false);
  };

  return (
    <div className="shadow-md w-full fixed top-0 h-20 z-40">
      <div className="md:flex items-center justify-between bg-white h-full px-7 md:px-16">
        <NavLink to="/">
          <div
            className="font-bold h-full text-2xl cursor-pointer flex items-center font-[Poppins] overflow-hidden
      text-gray-800"
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
          >
            {!hover && (
              <svg
                xmlns="http://www.w3.org/2000/svg"
                version="1.2"
                viewBox="0 0 3690 945"
                width="100%" // Set width to 100% to fill the parent div
                height="auto" // Automatically adjust height to maintain aspect ratio
                style={{ maxWidth: "100%", maxHeight: "100%" }} // Ensure it doesn't overflow
              >
                <title>RECT LOGO</title>
                <defs>
                  <image
                    width="872"
                    height="896"
                    id="img1"
                    href="data:image/png;base64,"
                  />
                  <image
                    width="2536"
                    height="468"
                    id="img2"
                    href="data:image/png;base64,"
                  />
                </defs>
                <style></style>
                <use id="Background" href="#img1" x="39" y="25" />
                <use id="Background" href="#img2" x="1111" y="239" />
              </svg>
            )}
            {hover && (
              <svg
                xmlns="http://www.w3.org/2000/svg"
                version="1.2"
                viewBox="0 0 3690 945"
                width="100%" // Set width to 100% to fill the parent div
                height="auto" // Automatically adjust height to maintain aspect ratio
                style={{ maxWidth: "100%", maxHeight: "100%" }} // Ensure it doesn't overflow
              >
                <title>RECT LOGO</title>
                <defs>
                  <image
                    width="872"
                    height="896"
                    id="img1"
                    href="data:image/png;base64,"
                  />
                  <image
                    width="2536"
                    height="468"
                    id="img2"
                    href="data:image/png;base64,"
                  />
                </defs>
                <style></style>
                <use id="Background" href="#img1" x="39" y="25" />
                <use id="Background" href="#img2" x="1111" y="239" />
              </svg>
            )}
          </div>
        </NavLink>
        <div
          onClick={() => setOpen(!open)}
          className="text-3xl absolute right-8 top-6 cursor-pointer md:hidden"
        >
          <FontAwesomeIcon icon={open ? faTimes : faBars} />
        </div>

        <ul
          className={`md:flex md:items-center md:pb-0 pb-12 absolute md:static bg-white md:z-auto z-[-1] left-0 w-full md:w-auto md:pl-0 pl-9 transition-all duration-500 ease-in ${
            open ? "top-20 " : "top-[-490px]"
          }`}
        >
          {Links.map((link) => (
            <li key={link.name} className="md:ml-8 text-xl md:my-0 my-7">
              <NavLink
                to={link.link}
                className={`duration-500 ${
                  location.pathname === link.link
                    ? "text-[#012F6B] font-semibold"
                    : "text-black hover:text-gray-500"
                }`}
              >
                {link.name}
              </NavLink>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Nav;
